atom-text-editor .gutter .line-number.git-line-modified,
atom-text-editor::shadow .gutter .line-number.git-line-modified {
  border-left: 2px solid #ebcb8b;
  padding-left: calc(0.5em - 2px);
}
atom-text-editor .gutter .line-number.git-line-added,
atom-text-editor::shadow .gutter .line-number.git-line-added {
  border-left: 2px solid #a3be8c;
  padding-left: calc(0.5em - 2px);
}
atom-text-editor .gutter .line-number.git-line-removed:before,
atom-text-editor::shadow .gutter .line-number.git-line-removed:before {
  position: absolute;
  left: 0;
  bottom: -4px;
  height: 0;
  width: 0;
  content: " ";
  border: solid transparent;
  border-left-color: #bf616a;
  border-width: 4px;
  margin-top: -4px;
  pointer-events: none;
}
atom-text-editor .gutter.git-diff-icon .line-number,
atom-text-editor::shadow .gutter.git-diff-icon .line-number {
  width: 100%;
  border-left: none;
  padding-left: 0.4em;
}
atom-text-editor .gutter.git-diff-icon .line-number:before,
atom-text-editor::shadow .gutter.git-diff-icon .line-number:before {
  font-family: 'Octicons Regular';
  src: url("octicons.woff") format("woff");
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  position: relative;
  top: -0.05em;
  height: 0px;
  width: 1em;
  content: " ";
  padding-right: 0.4em;
  font-size: .95em;
}
atom-text-editor .gutter.git-diff-icon .line-number.git-line-modified:before,
atom-text-editor::shadow .gutter.git-diff-icon .line-number.git-line-modified:before {
  content: "\f052";
  color: #ebcb8b;
}
atom-text-editor .gutter.git-diff-icon .line-number.git-line-added:before,
atom-text-editor::shadow .gutter.git-diff-icon .line-number.git-line-added:before {
  content: "\f05d";
  color: #a3be8c;
}
atom-text-editor .gutter.git-diff-icon .line-number.git-line-removed:before,
atom-text-editor::shadow .gutter.git-diff-icon .line-number.git-line-removed:before {
  border: none;
  content: "\f0ca";
  color: #bf616a;
  position: relative;
  top: .6em;
}
